      <p><b>Self-governance</b>, <b>self-government</b>, or <b>autonomy</b> is an abstract concept that applies to several scales of <a href=""https://en.wikipedia.org/wiki/Organization"">organization</a>.</p>
      <p>It may refer to personal conduct or family units or to larger scale activities including professions, industry bodies, religions, political units (usua");
                WriteLiteral(@"lly referred to as local government), including autonomous regions or others within nation-states that enjoy some sovereign rights. It falls within the larger context of governance and principles such as consent of the governed, and may involve non-profit organizations and corporate governance.
