      <h2>Means of self-governance</h2>
      <hr/>
      <p>This article focuses on the self-governance of professions, industries including unions, and formal or informal political units including ethnic or ethical 'nations' not defined by national borders, and of religious organizations, which have professional and political elements.  There are many historical examples of such organizations or groups, and some, e.g. the <a href=""https://en.wikipedia.org/wiki/Roman_Catholic_Church"">Roman Catholic Church</a>, the <a href=""https://en.wikipedia.org/wiki/Freemasons"">Freemasons</a>, the <a href=""https://en.wikipedia.org/wiki/Iroquois_Confederacy"">Iroquois Confederacy</a>, have his");
                WriteLiteral(@"tories going back centuries, including vast bodies of precedent and shared culture and knowledge.</p>
      <p>A means of self-governance usually comprises at least the following:</p>
      <ul>
         <li>An ethical code that outlines acceptable behavior within the unit or group, e.g. the Hippocratic Oath of doctors, or established codes of professional ethics.</li>
